  return (
    <div className="main_page ps-2 " id="mainPage">
      <Boxes />
      <TableOfProducts />
      <div className="col-12 col-lg-6">
        <div>11111111111</div>
        <canvas id="myChart" height="195"></canvas>
      </div>
    </div>
  );
};
